/**
 * Created by ovesh on 25/8/20.
 */
import React from 'react';
import Form from "./Form";
import {Link} from "react-router-dom";
import Grid from "@material-ui/core/Grid";


function ResetPass(){
    return (
        <div>
            <Form/>
            <Grid container
                  direction="row"
                  justify="center"
                  alignItems="center">
                <Link to="/">Login</Link>
                <hr width='80%'/>
                <Link to='signup'>SignUp</Link>
            </Grid>
        </div>
    );
}


export default ResetPass;
